            <div class="faq">

            <div>
            <h3>{this.props.question}</h3>
                <img src="../icon-arow-down.svg" />
            </div>
            <div>
                <p>{this.props.answer}</p>
            </div>

            </div>

        );
    }
}

export default QuesAnsw;
